import React from 'react';
import NavigationBar from '../components/NavigationBarLogged';

var ID;
var firstName;
var lastName;
var Intro;
var CS1;
var CS2;
var Total;

function readCookie()
{
	var data = document.cookie;
	var splits = data.split(",");
    for(var i = 0; i < splits.length; i++) 
	{
		var thisOne = splits[i].trim();
		var tokens = thisOne.split("=");
        if(tokens[0] == "ID"){
            return parseInt(tokens[1].trim());
        }
        else if( tokens[0] == "firstName" )
		{
			return tokens[1];
		}
		else if( tokens[0] == "lastName" )
		{
			return tokens[1];
		}
		else if( tokens[0] == "Intro" )
		{
			return tokens[1];
        } 
        else if (tokens[0] == "CS1")
        {
            return tokens[1];
        } 
        else if (tokens[0] == "CS2")
        {
            return tokens[1];
        } 
        else if(tokens[0] == "Total")
        {
            return tokens[1];
        }
    }

}

const LoggedInPage = () => {
firstName = readCookie("firstName");
lastName = readCookie("lastName");
    return(
        <div>
            <NavigationBar />
          <br/>  <h1> Logged In </h1> <br/>
    <p> You are logged in as {firstName.value} {lastName}</p>
        </div>

    );
};

export default LoggedInPage;
